import React from 'react';

import { 
    Button,
    Panel,
    PanelHeader,
    Group,
    Separator,
    Header,
    SimpleCell,
    Div,
    ScreenSpinner,
    FormLayout,
    FormStatus,
    Slider,
    Placeholder,
    } from '@vkontakte/vkui';


import Icon28FavoriteOutline from '@vkontakte/icons/dist/28/favorite_outline';
import Icon28CoinsOutline from '@vkontakte/icons/dist/28/coins_outline';
import Icon28BillheadOutline from '@vkontakte/icons/dist/28/billhead_outline';
import Icon28FireOutline from '@vkontakte/icons/dist/28/fire_outline';


export default class Start extends React.Component {
        constructor(props) {
            super(props);
            this.state = {
                api_url: "https://xelene.ru/road/php/index.php?",
                AgeUser: 0,

            }
            var propsbi = this.props.this;
            this.setPopout = propsbi.setPopout;
            this.showErrorAlert = propsbi.showErrorAlert;
        }
        ChangeAge(age) {
            this.setPopout(<ScreenSpinner/>)
            fetch(this.state.api_url + "method=account.setAge&age=" + age + "&" + window.location.search.replace('?', ''))
            .then(res => res.json())
            .then(data => {
              if(data.result) {
                  console.log('registred')
              }
            })
            .catch(err => {
              this.showErrorAlert(err)
            })
          }
        render() {

            return (
                <Panel id={this.props.id}> 
                <PanelHeader
                >
                Road to Jedi
                </PanelHeader>

                <Placeholder header=''>
                  Вам присвоен номер #{this.props.account.id !== undefined ? this.props.account.id : "undefined"}
                  Помните, отвечать нужно вдумчиво. После
                  ответа Команда наших специальных агентов
                  проверит его и в случае отрицательной
                  оценки — оставит комментарий, если все
                  хорошо, Вы получите уведомление.
                </Placeholder>
            </Panel>
            )
            }
        }
